import React from 'react'
import { Box, VStack, StackDivider} from "@chakra-ui/react";
function Navbar() {
  return (
    <VStack
      divider={<StackDivider borderColor="gray.200" />}
      spacing={4}
      align="stretch"
    >
      <Box h="40px" bg="yellow.200" mt={5}></Box>
    </VStack>
  );
}

export default Navbar
